import TextField from "../../Components/TextField.jsx";
import { useNavigate } from 'react-router-dom';
import { React } from "react";
import styles from "./Information.module.css";
import GlobalStyles from "../Global.module.css";

const Information = () => {
    let navigate = useNavigate();

    return (



        <div className={GlobalStyles.setup}>
        <div>
            <button className={GlobalStyles.button} type="button" onClick={() => navigate('/')}>Back</button>
            <form className={GlobalStyles.page} onSubmit={() => navigate('/AdminView')}>
                <h1 className={GlobalStyles.titleText}>Contact Information</h1><br />
                <label className={styles.InputPrompt}>First Name</label>
            <input className={styles.Input}/>
                    <label className={styles.InputPrompt}>Last Name</label>
                    <input required className={styles.Input}/>
                    <label className={styles.InputPrompt}>Email</label>
                    <input required className={styles.Input}/>
                    <label className={styles.InputPrompt}>Address</label>
                    <input required className={styles.Input}/>
                    <label className={styles.InputPrompt}>City</label>
                    <input required className={styles.Input}/>
                    <label className={styles.InputPrompt}>State</label>
                    <input required className={styles.Input}/>
                    <label className={styles.InputPrompt}>Zip Code</label>
                    <input required className={styles.Input}/>

                <button className={GlobalStyles.button}type="submit">Continue</button>

                <button className={GlobalStyles.specialButton} onClick={()=> navigate('/')}>Change or Cancel</button>
            </form>
        </div></div>
    );
}

export default Information;
